@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:ATM a owl:Class .
:Transaction a owl:Class .
:Receipt a owl:Class .
:hasTransaction owl:ObjectProperty ;
  rdfs:domain :ATM ;
  rdfs:range :Transaction .
:printsReceipt owl:ObjectProperty ;
  rdfs:domain :ATM ;
  rdfs:range :Receipt .
:completedTransaction a owl:Restriction ;
  owl:onProperty :hasTransaction ;
  owl:someValuesFrom :Transaction .
:ATM rdfs:subClassOf :completedTransaction ,
  [ a owl:Restriction ;
    owl:onProperty :printsReceipt ;
    owl:someValuesFrom :Receipt ] .
